{"9": ["Эти лампы приравниваются к ксенону. Из-за них лишили прав. ", "2021-02-28T06:25:59Z", "белый", "0", 9, 2, 1, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "12": ["Лампы светят хорошо, на киа рио встали нормально, но спустя 1,5 месяца одна лампа перегорела", "2021-02-20T16:38:13Z", "белый", "0", 1, 0, 1, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "19": ["Хороший, яркий свет, не слепит встречку. Были проблемы с подключением, но это из-за самой машины, горел ближний и дальний свет одновременно, но благо, все решилось небольшой манипуляцией.", "2021-02-02T04:30:39Z", "белый", "0", 1, 0, 4, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "26": ["Изначально горели хорошо, потом ближний свет потускнел и ночью ничего не видно, а дальный все отлично.", "2021-01-18T20:23:35Z", "белый", "0", 1, 0, 2, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "27": ["Тусклеют на глазах, по началу горят а потом Тусклеют так что дороги не видно! Возврат! ", "2021-01-11T16:28:24Z", "белый", "0", 1, 0, 1, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "28": ["На вид качество отличное и работают все диоды! Снимаю звёзды потому что на одной из ламп не было пластикааого кольца которое вставляется в фару а в него уже лампа, сразу не заметил глянул что хорошо выглядят и забрал, через неделю приехал в гараж и огорчился, надо как-то теперь колхозить это кольцо((( в остальном лампы хорошие!", "2020-12-30T20:13:23Z", "белый", "0", 2, 0, 3, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "30": ["Свет отличный за эти деньги, СТГ чёткие, минус коробка с лампами открытую получал.", "2021-01-09T14:38:27Z", "белый", "0", 1, 0, 4, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "31": ["Лампочки пришли быстро. Все отлично \nНа киа рио 2 подошли идеально даже не пришлось фары регулировать стг есть . Посмотрим на сколько хватит", "2021-01-07T14:24:56Z", "белый", "0", 0, 1, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "32": ["Не держит не один телефон нашей семьи. Ужас просто", "2021-01-07T09:46:35Z", "белый", "0", 0, 4, 1, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "34": ["Покупал лампы год назад. Работали отлично.  Одна работает нормально одна через пол года стала отключаться сама включается сама. Думаю поискать другие лампы (((из за этого три зведы", "2021-01-04T08:08:33Z", "белый", "0", 3, 0, 3, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "35": ["Лампы то, что нужно. Работают. Спасибо.", "2021-01-03T13:40:48Z", "белый", "0", 3, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "36": ["Пришли быстро. На KIA Rio подошли как родные. Светят хорошо, встречку не слепят.", "2020-12-31T08:56:02Z", "белый", "0", 3, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "37": ["Был доволен одну ночь, сегодня начал мерцать ближний свет в левой фаре, сказать что я расстроен, это ничего не сказать.", "2020-12-28T17:25:38Z", "белый", "0", 3, 0, 2, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "38": ["Мне понравились, пользуюсь уже неделю ", "2020-12-26T17:00:57Z", "белый", "0", 1, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "42": ["Муж в восторге. Сказал,что очень хорошие ", "2020-12-15T13:37:32Z", "белый", "0", 2, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "45": ["Светят ярко, очень быстрый монтаж, проблем нет", "2020-12-12T08:27:21Z", "белый", "0", 1, 0, 4, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "46": ["Хороший, яркий, плотный свет в рефлекторной оптике Киа Рио, грамотно сделана граница света, лампа не слепит светит четко на дорогу.", "2020-12-04T09:39:37Z", "белый", "0", 1, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "48": ["Хорошие лампы, светят не хуже галогенок. Пользовался полгода, потом продал авто. При установке, если возникли сложности с радиатором, можно снять пластиковое кольцо, и установить его отдельно, а после этого вставить на место саму лампу с радиатором. Очень удобно.", "2020-12-01T16:00:43Z", "белый", "0", 1, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "49": ["Светят очень плохо . Как габаритные огни . Составил заявление на возврат и тишина . Прошло 7 дней . Так отказываются принимать .", "2020-11-30T15:12:35Z", "белый", "0", 1, 1, 1, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "54": ["Фирма совсем другая пришла щас буду проверять потом напишу отзыв", "2020-11-06T03:21:38Z", "белый", "0", 1, 1, 3, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "57": ["Лампы по себе добротные и не хлипкие, но вот сам диод и шторка оставляют желать лучшего. Как только подключил получил лишь ВАУ эффект, что в фаре светят ярко, но дорого не освещают вообще никак. Еще самый главный минус, от которого я просто пришел в ярость - перепутан ближний и дальний свет. Я весь вечер ездил с дальним, потому что он светит хоть как-то, но на дальний не тянет. И вот я только потом понял, что дальний и ближний перепутаны. После этого я поездил еще 5 дней и мне это надоело, поставил обратно свой галоген. Чтобы вы понимали, обычный галоген на ближнем освещает как дальний с этими \"led\" лампами.  Пустая трата денег... Единственное на что они годятся, это придать вид автомобилю и как-то его обозначить на дороге и все, ни о какой безопасности речи не идет, езда в слепую.", "2020-10-30T12:17:55Z", "белый", "0", 4, 1, 2, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "58": ["Полгода как езжу на этих лампах - полёт нормальный. Освещение дороги хорошее, линия горизонта чёткая, встречку не слепит. Претензий нет. За эту сумму то что надо.", "2020-10-23T17:56:01Z", "белый", "0", 0, 2, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "59": ["Испортили настроение,одна лампочка проработала 20 секунд,подарила мужу на микроавтобус,но подарок  неудачный. Качество отвратительное.", "2020-10-19T14:38:20Z", "белый", "0", 2, 0, 1, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "60": ["Все работает отлично,стг четкая,не знаю почему у других подругому,все четко,только шли долго!в этом минус.", "2020-10-15T16:56:28Z", "белый", "0", 0, 2, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "61": ["Работаю отлично. Брал для нивы 21214", "2020-10-14T18:36:07Z", "белый", "0", 0, 1, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "62": ["Светят вроде хорошо, на рио3 подошли нормально, встречка не ругается, посмотрим сколько прослужат", "2020-10-09T16:37:04Z", "белый", "0", 0, 1, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "63": ["Лампы пришли..заказывал Визант, а пришли консул. Как бы я не заказывал фирму консул, не понимаю продавцов, зачем пихать товар другой фирмы если есть свой? Тем более что в описании не указано что могут прислать другую фирму!! Поставил я их на ваз 2109, ближний светит так себе как дешевая галогенка только белым, на счёт дальнего света, там ещё печальнее картина, когда включаешь дальний такое ощущение что туманки включил, освещает только обочину! Товаром не доволен вообще, может это из-за фирмы или просто брак какой,но деньги я выкинул на ветер. Лохотрон!!!", "2020-10-08T17:43:50Z", "белый", "0", 4, 0, 1, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "64": ["Лампы святят плохо, дальнего нет совсем, одна лампочка пришла не рабочая горит в пол накала. Не стоят своих денег.", "2020-10-06T19:17:20Z", "белый", "0", 2, 0, 2, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "65": ["Тот кто пишет что супер, не верьте( Или они ещё не ездили на нормальных LED\nОчень тусклый свет(\nЭто моё мнение, а там смотрите сами, брать или нет", "2020-10-05T17:01:29Z", "белый", "0", 3, 0, 4, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "67": ["Лампочки пришли в хорошей упаковке всё работает на отлично советую", "2020-10-05T13:47:19Z", "белый", "0", 0, 2, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "68": ["Хуже нет , музыку накатил, лампочка стала под музыку с дальним играть 😂, и смешно и обидно", "2020-10-05T00:13:16Z", "белый", "0", 3, 0, 1, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "69": ["Купил для того, чтобы у ДХО вашего же производства (5000 К) не было сильного контраста по цвету с галогенками. В итоге ситуация странная: конечно, никаких 4000 люмен тут нет и в помине. Лампы светят чуть лучше галогена. С учётом другой цветовой температуры — кажутся ярче. СТГ ровная, освещенность тоже вполне хорошая. Встречку не слепит. Дальний отличный.  Но. У вас заявлена температура 5000 К, по факту ближе к 6500 К (см. фото, ДХО ваши же, с правильной температурой). Что это: брак, пересортица или \"у нас так принято\"?", "2020-10-04T16:32:57Z", "белый", "0", 4, 0, 3, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "70": ["Пришли быстро. Все работает хорошо. Надеюсь проработают долго.", "2020-10-04T12:46:14Z", "белый", "0", 0, 1, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "71": ["Лампы отличные. Пришли в фирменной упаковки, коробка целая. Доставка меньше чем за сутки. Светят ярко, есть граница света, «галочка», поэтому не слепят встречных водителей. Свет белый. То что надо! Фото нет, потому что сразу установили и муж ее порвал.", "2020-10-02T07:48:49Z", "белый", "0", 0, 1, 5, "Светодиодные ла