сав о замене, мне сказали отправить данные кому и куда отправлять, на почту. Отправил, минут через 40 мне скинули номер отслеживания посылки СДЭК, и через 2-3 дня мне пришли уже новые лампы. Честно был удивлен. Товаром доволен, т. К за эту стоимость лучше не найти! P. S ездил на этих лампах еще 2016, но потом начали лишать, в 2020 было пересмотрение, и я снова на них, в два этажа😎", "2020-09-11T13:48:47Z", "белый", "0", 1, 2, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "96": ["Лампы горят, все норм, но пришлось вернуть, так как не закрывается крышка, с размером прогадал, HUNDAY solaris 2014", "2020-08-19T09:49:55Z", "белый", "0", 2, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "99": ["Лампы качество хорошее, светят очень даже хорошо, белый яркий свет.Как купил поехали в поездку на 1000км тест драйв  прошли отлично.  Вообщем лампы стоят своих денег берите смело.", "2020-08-15T21:53:20Z", "белый", "0", 1, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "103": ["Лампы огонь! Поставил на скутер, по сравнению со штатными северное сияние и бараньи яйца!", "2020-07-25T17:13:01.485556288Z", "белый", "0", 3, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "106": ["Ну что сказать,пять звёзд,за цену и качество,упаковка пришла не запечатанной,хотя все в целости и без следов установки,без проблем стал на Хендай Акцент, светом доволен,но не на все сто,радует только то,что встречки не ругаются),как на прежнем ксеноне, и генератору стало легче жить),энергопотребление незаметно),сколько прослужит покажет время.....и ещё,уважаемые производители,не вводите в заблуждение людей,которые в законах полные ослы),эти лампы запрещены,как и любые другие несоответсвующие определённой фаре,а что касается регламента,это ты потом в суде доказывать будешь),и по большому счету,если ты профан,не имеешь опыта общения с инспектором ,денег,связей и т.д,т