околь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "179": ["Размер цоколя больше чем стандартный, пришлось обтачивать надфилем иначе не влезал в фару.", "2019-10-11T17:00:15.60816284Z", "белый", "0", 5, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "180": ["Пришло все целое. Лампы горят. Но не лезет цоколь на Рено Сандеро Степвей 2012 г.в. замерил штангелем на светодиодках на мм больше диаметр, чем на галогенках.", "2019-10-03T12:46:28.387237791Z", "белый", "0", 9, 0, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "182": ["Лампы отличные. СТГ четкая, как на галогенках, а свет намного лучше. Встречку не слепит. На ВАЗ 2114 встали хорошо, крышка легко закрылась, хотя они длиннее старых светодиодов. Сегодня ехал в дождь, видно отлично. Тем кто разочаровался в светодиодах без шторки, советую эти, потому что свет реально хороший.", "2019-09-27T18:48:55.288130819Z", "белый", "0", 9, 1, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "184": ["Светит лучше галогена, доволен.", "2019-09-25T23:41:03.180215726Z", "белый", "0", 1, 1, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"], "185": ["До этого стояли галогенки за 1500 руб, вроде норм но не все таки не светят, эти раза в три четыре лучше и на мокром асфальте тоже хорошо светят, т. Е. За свои деньги это хорошо, даже очень. Рекомендую", "2019-09-22T17:58:08.824458259Z", "белый", "0", 3, 2, 5, "Светодиодные лампы D5 цоколь H4 с чипом csp 4000lm 5000k (2 шт.)", "Vizant"]}
